B.P4=new A.cv("This 50-card deck is a visual chronicle of Eva's artistic journey spanning from 2014 to 2024.\n\nEach of the pieces selected for this deck is a portal into a different metaphysical realm, each one telling its own story. However, the message behind the artwork is always unique and deeply personal for the viewer. Consider them an invitation to explore the mysteries of the mind, the Universe, and everything.\n\nIt's truly remarkable how visual art serves as a universal language, effortlessly bridging cultural and mental divides, offering a way to connect with one's own subconscious, unveiling answers that may have been there all along. Therefore, Oracle cards are a great introspection tool, helping you to tune in to your deeper levels of self. This phenomenon is evidence of genuine magic.",null,B.d9,null,null,null,null,null,null,null)
B.P5=new A.cv("Let your imagination wander and discover the magic that resonates with you!\n\nBefore you begin, get into a calm and open state of mind using whatever methods work for you personally.\n\nWith each spread, give yourself time to contemplate the images and the words on the card. Let messages come to you intuitively. There's no need to read the card descriptions unless you want to; the image itself may convey the most meaning to you - go with what feels right for you!",null,B.d9,null,null,null,null,null,null,null)
B.P6=new A.cv("I'm Eva Gamayun, a self-taught artist working in the genre of surrealism and the author of this oracle deck.\n\nMy paintings usually depict subjects in dream-like states, dissolving into their surroundings like mirages. I draw inspiration from nature, literature, scientific theories, ancient myths, the beauty of the human body, and the intricate illusions of the human mind. From an early age, I've discovered the ability to channel overwhelming emotions and curiosity into infinite imaginary realms. Imagination games soon became my second nature, a physical necessity, that eventually blossomed into an art career. Since that time, I have dreamed of worlds where the boundaries between internal and external, material and digital, scientific and magical are blurred. These dreams are translated into my art, bringing the viewer a message, a story, or an invitation to embark on a journey.\n\nOver the past 13 year I have developed a unique style of acrylic painting to convey stories of self-discovery and to visualize dreams of other worlds.",null,B.d9,null,null,null,null,null,null,null)
